Artık main kısmını oluşturmaya başlayabiliriz. “index.html”deki, biri hariç bütün "li" taglerini siliyoruz. "ul" kısmını da dahil ederek bir "div" tagine sarıyoruz. "li" içine yine bir "div" ekliyoruz. Onun içine ürün resminin geleceği "img" tagi ekliyoruz. Ve ürün ismi, ürün markası, ürün fiyatı ve ürün değerlendirmesi için birer "div" açıyoruz. Ve son olarak her birine ilgili isimlerle class açıyoruz.

```html
    <main class="main">
        <div class="content">
            <ul class="products">
                <li>
                    <div class="product">
                        <img src="images/p1.jpg" alt="urun"/>
                        <div class="product-name">Kazak</div>
                        <div class="product-brand">Walakiki</div>
                        <div class="price">100₺</div>
                    </div>
                </li>
            </ul>
        </div>
    </main>
```

Şimdi "img" içindeki yola uygun biçimde bir resim ekleyelim.”template” in bulunduğu dosyaya “images” dosyası açıyoruz. İçine herhangi bir resim sürükleyip bırakıyoruz. Sonra sağ tıklayıp “rename” e basıp buradaki ismi veriyoruz ki resmi bulabilsin. Kısa isimler verirseniz işiniz daha kolay olur. Bu işlemden sonra artık resmi sayfamızda görebiliriz. Ve alt kısmında ürün ismi markası ve fiyatı da görünüyor. Fakat resim kendi büyüklüğünde ve şu anki görünüm korkunç :D. Şimdi bu görünümü düzenlemeye başlayalım. 

```css
.products {
    display: flex;
    justify-content: center;
    align-items: center;
}

.products li {
    flex: 0 1 25rem;
    margin: 1rem;
    height: 50rem;
    border-bottom: .1rem rgb(216, 216, 216) solid;
    list-style-type: none;

}

.product-image {
    max-width: 34rem;
    max-height: 34rem;
}
```

Önceliğimiz tüm ürünlerin ortalanması. Bunun için de flex ayarlamalarını yapıyoruz. “justify-content” ve “align-items”e center içeriğimizi ortalar.
 İkinci olarak ürünler içindeki tüm "li" lere stil veriyoruz. “flex” özelliğinde görüldüğü üzere 3 seçenek oluşturuyoruz. Birincisi "flex-grow" : Esnek bir ürünün gerektiğinde büyüme yeteneğini tanımlar. İkincisi ise "flex-shrink" satırda yeterli alan olmadığında esnek ürünün diğer esnek öğelere göre ne kadar küçüleceğini ayarlar. Üçüncü seçenek "flex-basis": esnek öğenin başlangıç boyutunu belirtir. Bu seçenekleri eğer istersek ayrı ayrı da tanımlayabiliriz.
Border ve yükseklik istediğimiz gibi ayarlıyoruz. İstenmeyen liste stilinden kurtulmak için “list-style-type: none” ekliyoruz. Son olarak resme de maksimum ulaşabileceği büyüklüğü tanımlıyoruz. 

```html
    <div class="product-name">
        <a href="product.html">Kazak</a>
    </div>
```

Şimdi diğer ürün seçeneklerine bakalım. Öncelikle ürün ismini yukarıdaki gibi "a" tagi ile saralım ki bizi bir yerlere götürebilsin. Tanımladığımız yol ise şimdilik yok. Stil verme işlemiyle devam ediyoruz.

```css
.product-name {
    font-size: 2rem;
}

a {
    text-decoration: none;
    color: black;
}

.product-brand {
    font-size: 1.5rem;
    color: #a3a3a3;
}

.product-price {
    font-size: 2.5rem;
    font-weight: bold;
    color: #fc6405;
}
```

Ürün ismi,  marka ve fiyat  için boyut ve renk ayarlıyoruz. 

```css
.product {
    display: flex;
    flex-direction: column;
    justify-content: space-between;
    height: 100%;
}
```

Burada ise sıraladığımız ürün ismi, markası ve fiyatını, resmin altına, yukarıdan aşağıya eşit aralıklarla yerleştirdik. Yine yüksekliği 100% yapıyoruz, yoksa tüm boş alanı kullanmıyor.
Fiyatın hemen üzerine yıldız ve yorum kısmını ekleyelim. Yıldız kısmı şimdilik yazıyoruz, ileride düzelteceğiz. 
```html
    <div class="product-rating">4.0 Yıldız (10)</div>
```

Şimdilik stil vermemeyi tercih ettim.
 Şu anda bir ürünümüz mevcut. Birden fazla ürün eklendiğinde nasıl görüneceğine bakmak için “index.html”deki "li" leri çoğaltalım. Çoğalttığımızda aşağı doğru değil yana doğru sıralandığını görüyoruz.

